// src/Leaderboard.js
import React from 'react';
import './leaderb.css';

const Leaderboard = () => {
  // Replace this data with your actual leaderboard data
  const leaderboardData = [
    { id: 1, name: 'User 1', score: 100 },
    { id: 2, name: 'User 2', score: 90 },
    { id: 3, name: 'User 3', score: 80 },
    // Add more data as needed
  ];

  return (
    <div className="leaderboard-wrapper">
      <h1 className="leaderboard-title">GitHub Copilot Leaderboard</h1>
      <ol className="leaderboard-list">
        {leaderboardData.map((item) => (
          <li className="leaderboard-item" key={item.id}>
            <span>{item.name}</span>
            <span>{item.score} points</span>
          </li>
        ))}
      </ol>
    </div>
  );
};

export default Leaderboard;
